import ModalAdd from "./ModalAdd";

function AddtoCart() {
  return (
    <div>
      <ion-toolbar class="menu-bar-wrap">
        <ion-buttons class="menu-btn">
          <ion-button class="favorite-btn s-inactive"></ion-button>
          <ion-button class="main-footer-btn active">Add to Cart</ion-button>
        </ion-buttons>
      </ion-toolbar>
      <ModalAdd />
    </div>
  );
}

export default AddtoCart;
